sys_variable_value.value:
(function execute(inputs, outputs) {

  const keys = JSON.parse(inputs.response_body).map(key => {
    return {
      id: key.id,
      title: key.title,
      read_only: key.read_only
    }
  });

  if (keys.length) {
    outputs.keys = keys;
  }

})(inputs, outputs);

